import Product from "./Product";
import {storeProducts} from '../data';

export default class ProductList extends Component{
  constructor(props) {
    super(props);

  this.state={
    products:storeProducts
  };
}

  render() { return (
      <React.Fragment>
      <div className='py-5'>
      <div className='container'>
      <div className='title-products'>Our Products</div>
      <div className='row'>
      </div>
      </div>
      </div>
      </React.Fragment>
    )
  }
}
